import React, {useEffect, useState} from 'react'


function App(){

  const [backendData, setBackendData] = useState([{}])
  useEffect(() => {
    fetch("/notes").then(
      response => response.json()
    ).then(
      data => {
        //console.log(data)
        setBackendData(data)
      }
    ).catch(err => console.log(err));
  }, [])

  return (
    <div style>
      <table>
        <thead>
          <th>id</th>
          <th>title</th>
          <th>content</th>
          <th>created</th>
        </thead>
        <tbody>
          {backendData.map((d,i) =>(
            <tr key={i}>
              <td>{d.id}</td>
              <td>{d.title}</td>
              <td>{d.content}</td>
              <td>{d.created}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  )
}

export default App
